import Link from 'next/link'
import React from 'react'
import Layout from '../components/Layout'

const nuevoProducto = () => {
  return (
    <Layout>
        <h1 className = "text">Crear nuevo producto</h1>
    </Layout>
  )
}

export default nuevoProducto
